  [],\n\t\"num_tags\": 0,\n\t\"name\": \"benthic-faunal-sampling-adjacent-to-the-barbers-point-ocean-outfall-oahu-hawaii-1986-2010-nodc-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Benthic fauna in the vicinity of the Barbers
  Point (Honouliuli) ocean outfall were sampled from 1986-2010. To assess the environmental
  quality, sediment grain size and sediment chemistry were measured. To identify the
  fauna, mollusk species and non-mollusk species sitings were tabulated. Stations
  were located both within and on the boundary of the zone of initial dilution (ZID)
  and at distances of 1.2 to 2 km from the ZID boundary. In summary, the response
  patterns of benthic fauna near the Barbers Point ocean outfall showed little or
  no indication of a strong influence by the diffuser effluent.nnSeven stations previously
  established along the approximate diffuser isobath (61 m) were surveyed. In 1990
  survey station names were changed from those used in the 1986 survey (Nelson et
  al. 1987). Survey stations (1986 station names are in parenthesis) and their locations
  are as follows:nStation HB1 (A) Approximately 3.5 km east of the zone of initial
  dilution (ZID) boundary to evaluate effects far-field and beyond the ZIDnStation
  HB2 (B) On the northeast ZID boundarynStation HB3 (C) On the southeast ZID boundarynStation
  HB4 (D) On the southwest ZID boundarynStation HZ (Z) Within the ZID to evaluate
  diffuser effectsnStation HB6 (E) Approximately 0.5 km southwest of the ZID boundary
  as a near-field reference stationnStation HB7 (F) Approximately 3.5 km southwest
  of the ZID boundary as a far-field reference stationnnSAMPLING PERIODS:nSeptember
  1986nFebruary 1990nJuly 1991nFebruary 1992nJune 1993nJune 1994nJanuary 1995nJanuary
  1996nJanuary-February 1997nJanuary 1998nApril 1999nFebruary-March 2000nJanuary 2001nJanuary
  2002nJanuary 2003nJune 2004nFebruary 2005nFebruary 2006nJuly 2007nJune 2008nMarch
  2009nJune 2010nnmissing years: 1987-89nnMETHODOLOGY:nThe sampling methodology used
  in this study generally followed the recommendations of Swartz (1978) and US EPA
  guidelines (EPA 1987a, 1987b), hereafter refered to as EPA procedures.nnA modified
  0.16-m2 van Veen grab sampler deployed from a stern-mounted A-frame on the research
  vessel Noi I Kai was used to obtain bottom samples at all seven stations. Penetration
  of the sampler was adequate for all replicates. The minimum penetration depth for
  all grabs was 8 cm and the maximum was 15 cm.nnFive van Veen grabs were taken at
  each station. A subsample 7.6 cm in diameter by 5 cm deep was taken from each grab
  sample for infaunal analysis and a subsample 4.8 cm in diameter by 5 cm deep for
  mollusk analysis. Subsampling was necessary because the epifauna and infauna in
  the area are known to be both small and abundant and processing of the entire sample
  would be impractical. Replicated grab samples at each station, rather than replicated
  subsamples from one grab sample, were used to provide information on intrastation
  variability. All six nonmollusk subcores were processed on a 0.5-mm screen.nnSamples
  for geochemical analyses (total organic carbon (TOC), oxidation-reduction potential
  (ORP), sediment oil and grease (O&G), total Kjeldahl nitrogen (TKN), and grain size)
  were obtained from the grabs from which the biological subcores were taken. Each
  replicate van Veen grab contained more than enough sediment for both purposes (methods
  HI0020117). Three subsamples 7.6 cm in diameter by 5 cm deep (one from each of three
  differnt grab samples) were taken from all stations. The top 2 cm of sediment of
  each subsample were used for geochemical analysis. Samples for TOC and sediment
  O&G analysis were put in screw-cap jars, placed on ice, and taken to the laboratory
  for analysis. Sediment analyses of sediment grain size, ORP, TKN, and O&G followed
  EPA procedures. Analysis of TOC was carried out by PACE, Inc. Laboratory (Southern
  California).\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
